// src/pages/Foruns/ForunsListPage.js
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import TribunaisListFeed from '../../../components/BDPages/Feedbacks/TribunaisListFeed'
import HeaderLggd from '../../../components/HeaderLggd';
import Footer from '../../../components/Footer';
import ContainerLggd from '../../../components/ContainerLggd';
import style from '../../../components/Card/Card.module.css';

const TribunaisindexFeed = () => {
  

  

  return (
    <>
      <HeaderLggd>
      </HeaderLggd>
      
      <ContainerLggd><Link to="/" className={style.backButton}>← Voltar</Link>
      
        <div className="flex flex-col items-center justify-center space-y-4 h-screen">
          <h2 className="text-center text-xl">Feedbacks</h2>
        </div>
        <TribunaisListFeed />
      </ContainerLggd>
      <Footer />
    </>
  );
};

export default TribunaisindexFeed;
